package com.example.problemsolving.string;

import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class ValidAnagram {
    public static void main(String[] args) {
        System.out.println(isAnagram2("",
                ""));
    }


    public static boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) return false;
        Map<Character, Integer> stringS = new HashMap<>();
        Map<Character, Integer> stringT = new HashMap<>();
        int len = s.length();
        for (int i = 0; i < len; i++) {
            char ch = s.charAt(i);
            if (!stringS.containsKey(ch)) stringS.put(ch, 1);
            else stringS.put(ch, stringS.get(ch) + 1);
        }
        for (int i = 0; i < len; i++) {
            char ch = t.charAt(i);
            if (!stringT.containsKey(ch)) stringT.put(ch, 1);
            else stringT.put(ch, stringT.get(ch) + 1);
        }
        return stringS.equals(stringT);
    }

    public static boolean isAnagram2(String s, String t) {
        if (s.length() != t.length()) return false;
        char[] stringS = s.toCharArray();
        char[] stringT = t.toCharArray();
        Arrays.sort(stringS);
        Arrays.sort(stringT);
        for (int i = 0; i < s.length(); i++) {
            if (stringS[i] != stringT[i]) return false;
        }
        return true;
    }
}
